// 1. Configuration variables
const apiKey = "AIzaSyAG5QaKVhV6hEQdWz0B8GMvK9d4lfx25sI";
const lat = 43.6555; 
const lng = -70.2618;

const zoom = 20;
const size = "1000x1000"; 
const scale = "2"; 

// 2. Marker Configuration
// We define the color, size, and location of the pin
const markerColor = "white"; // You can use "red", "blue", "white", etc.
const markerSize = "mid";    // Options: "tiny", "small", "mid"
const markerString = `&markers=color:${markerColor}%7Csize:${markerSize}%7C${lat},${lng}`;

// 3. High-Contrast Dark Mode Styles
const styles = [
    "element:geometry|color:0x212121",
    "element:labels.icon|visibility:off",
    "element:labels.text.fill|color:0x757575",
    "element:labels.text.stroke|color:0x212121",
    "feature:administrative|element:geometry|color:0x757575",
    "feature:poi|element:geometry|color:0x181818",
    "feature:poi|element:labels.text.fill|color:0x3d3d3d",
    "feature:road|element:geometry.fill|color:0x2c2c2c",
    "feature:road|element:labels.text.fill|color:0x8a8a8a",
    "feature:road.highway|element:geometry|color:0x3c3c3c",
    "feature:water|element:geometry|color:0x000000",
    "feature:water|element:labels.text.fill|color:0x3d3d3d"
];

// 4. Construct the API Call URL
const baseUrl = "https://maps.googleapis.com/maps/api/staticmap";
const styleQuery = styles.map(s => `&style=${s}`).join("");

// Combine everything: Base + Center + Size + Scale + Marker + Key + Styles
const mapUrl = `${baseUrl}?center=${lat},${lng}&zoom=${zoom}&size=${size}&scale=${scale}${markerString}&key=${apiKey}${styleQuery}`;

// 5. Return the result to WeWeb
return mapUrl;
